import "./App.scss";
import Watch from "./pages/watch/Watch";
import Home from "./pages/home/Home";
// import Register from "./pages/register/Register";
// import Watch from "./pages/watch/Watch";
// import Login from "./pages/login/Login";

import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

const App = () => {
    const user = true;
    return (
        <Router>
            <Switch>
                <Route exact path="/">
                    <Home />
                </Route>
                <Route path="/movies">
                    <Home type="movie" />
                </Route>
                <Route path="/series">
                    <Home type="series" />
                </Route>
                <Route path="/watch">
                    <Watch />
                </Route>
            </Switch>
        </Router>
    );
};

export default App;
